import Quote from "./Quote";
import useQuotes from "../UseQuotes";

const Quotes = () => {
  const { filteredQuotes } = useQuotes();
  if (filteredQuotes.length > 0) {
    return (
      <div className="flex flex-col text-2xl w-3/4 space-x-8 space-y-4">
        {filteredQuotes.map((quote, index) => {
          return <Quote key={quote + index} quote={quote}></Quote>;
        })}
      </div>
    );
  } else {
    return (
      <div className="flex flex-col text-2xl w-1/2">
        <p>No quotes!</p>
      </div>
    );
  }
};

export default Quotes;
